              initial={{ opacity: 0, scale: 0.5 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{
                duration: 0.8,
                delay: 0.5,
                ease: [0, 0.71, 0.2, 1.01]
              }}
              onClick={() => {
                dispatch(count(1))
                dispatch(countState("dort"))
                dispatch(state("dort/normal"))
                dispatch(b(0))
              }}
